export function updateComponentsData(data) {
  return dispatch => {
    dispatch({
      type: "UPDATE_COMPONENTS_DATA",
      payload: data
    });
  };
}
export const updateComponentsConfig = payload => dispatch =>
  dispatch({
    type: "UPDATE_COMPONENTS_CONFIG",
    payload
  });
